import { Formik } from 'formik';
function onSubmit(e) {
  e.preventDefault();
  const { name, email } = e.target;
  console.log('name :', name.value, 'email:', email.value);
}

export default function Form() {
  return (
    <form onSubmit={onSubmit}>
      <label>
        name
        <input name="name" />
      </label>

      <label>
        email
        <input name="email" />
      </label>

      <button type="submit">send</button>
    </form>
  );
}
